import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { API_ENDPOINTS } from '../config/api';

function OrderList() {
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    fetchOrders();
  }, []);

  const fetchOrders = async () => {
    try {
      const response = await axios.get(API_ENDPOINTS.ORDERS);
      console.log('Orders data:', response.data);
      setOrders(Array.isArray(response.data) ? response.data : []);
    } catch (error) {
      console.error('Error fetching orders:', error);
      setOrders([]);
    }
  };

  const handleDeleteOrder = async (orderId) => {
    if (window.confirm('Are you sure you want to delete this order?')) {
      try {
        console.log('Attempting to delete order:', orderId);
        console.log('Delete URL:', `${API_ENDPOINTS.ORDERS}/${orderId}`);
        const response = await axios.delete(`${API_ENDPOINTS.ORDERS}/${orderId}`);
        console.log('Delete response:', response);
        await fetchOrders(); // Refresh the orders list
      } catch (error) {
        console.error('Error deleting order:', error);
        console.error('Error response:', error.response);
        console.error('Error message:', error.message);
        alert('Failed to delete order. Please check console for details.');
      }
    }
  };

  const handleDeleteAllOrders = async () => {
    if (window.confirm('Are you sure you want to delete ALL orders? This action cannot be undone.')) {
      try {
        await axios.delete(API_ENDPOINTS.ORDERS);
        setOrders([]); // Clear the orders list
      } catch (error) {
        console.error('Error deleting all orders:', error);
        alert('Failed to delete all orders. Please try again.');
      }
    }
  };

  return (
    <div className="ml-64 p-8">
      <div className="max-w-6xl mx-auto">
        <div className="flex justify-between items-center mb-8">
          <h1 className="text-3xl font-bold text-[#2E856E]">Orders</h1>
          <button
            onClick={handleDeleteAllOrders}
            className="px-4 py-2 bg-red-500 text-white rounded-lg hover:bg-red-600 transition-colors"
          >
            Delete All Orders
          </button>
        </div>
        <div className="bg-white rounded-2xl shadow-lg overflow-hidden">
          <div className="grid grid-cols-6 gap-4 bg-[#98DBBC] p-4 font-semibold text-[#2E856E]">
            <div>Order ID</div>
            <div>Customer</div>
            <div>Items</div>
            <div>Total</div>
            <div>Date</div>
            <div>Actions</div>
          </div>
          <div className="divide-y divide-gray-100">
            {orders.map((order) => (
              <div
                key={order.id}
                className="grid grid-cols-6 gap-4 p-4 hover:bg-gray-50 transition-colors"
              >
                <div className="text-[#2E856E] font-medium">#{order.id}</div>
                <div className="font-medium">{order.customer_name}</div>
                <div className="text-gray-600">
                  {order.items ? (
                    typeof order.items === 'string' ? (
                      order.items
                    ) : (
                      Array.isArray(order.items) &&
                      order.items.map((item, index) => (
                        <div key={index} className="text-sm">
                          {item.product_id?.product_name || 'Unknown Product'} x {item.quantity}
                        </div>
                      ))
                    )
                  ) : 'No items'}
                </div>
                <div className="font-bold text-[#2E856E]">
                  Rp {order.total_amount?.toLocaleString()}
                </div>
                <div className="text-gray-600">
                  {new Date(order.created_at).toLocaleDateString('id-ID', {
                    year: 'numeric',
                    month: 'long',
                    day: 'numeric'
                  })}
                </div>
                <div>
                  <button
                    onClick={() => handleDeleteOrder(order.id)}
                    className="px-3 py-1 bg-red-500 text-white rounded-lg hover:bg-red-600 transition-colors"
                  >
                    Delete
                  </button>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default OrderList;
